import Paypal from './Paypal/Paypal';
import styled from 'styled-components';
import bucc from './image/bucc.webp'

const DIV = styled.div`
    margin: 0 auto;
    border: none;
    box-shadow: 0px 0px 2px 0px;
    margin-top: 80px; 
    padding: 20px;
    max-width: 70%;
    border-radius: 20px;

    p{
        font-size: 28px;
    }
`
const Computing = () => {
    return (  
        <DIV>
            <img src={bucc} width = "60" alt="bucc" />
            <p>Computing and Engineering Sciences</p>
            <Paypal />
        </DIV>
    );
}
 
export default Computing;
